import { View } from "react-native"
import { Title } from "react-native-paper";

export const Layout = ({ navigation, token }) => (
    <View>
        { token ? 
            <Title>Welcome</Title>
            :
            <Title> You need login to see your trips </Title>
        }
    </View>
)
